pleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"xQF7RDSjQYQ\",\"title\":\"The secret world of Sugar Babies and Sugar Daddies | 60 Minutes Australia\",\"lengthSeconds\":\"1503\",\"keywords\":[\"60 Minutes\",\"60 Minutes Australia\",\"Liz Hayes\",\"Charles Wooley\",\"Tara Brown\",\"Liam Bartlett\",\"Allison Langdon\",\"Ellen Fanning\",\"Peter Overton\",\"Ray Martin\",\"Jana Wendt\",\"Jeff McMullen\",\"Jennifer Byrne\",\"Mike Munro\",\"Richard Carleton\",\"Tracey Curro\",\"Peter Harvey\",\"George Negus\",\"Ian Leslie\",\"Gerald Stone\",\"Sarah Abo\",\"sugar babies\",\"sugar daddies\",\"women\",\"fashion\",\"money\",\"elderly men\",\"university students\",\"investigation\"],\"channelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isOwnerViewing\":false,\"shortDescription\":\"Incredibly, right now in Australia there are more than 200,000 young women who have either become, or are trying to be, “sugar babies”. Their ambition is for a sweet life of pampered luxury, paid for by older, sometimes much older, men. For the so-called “sugar daddies”, the equation is simple: the wealthier they are, the more attractive they are. But as Sarah Abo finds out, it’s not hard to read between the lines here. The term sugar baby is often code for sex worker, and the male moneybags are often crinkled-up creeps. And that leads to a very important question: is this sugar baby phenomenon about empowering women or exploiting them?\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, heir ambition is for a sweet life of pampered luxury, paid for by older, sometimes much older, men. For the so-called “sugar daddies”, the equation is simple: the wealthier they are, the more attractive they are. But as Sarah Abo finds out, it’s not hard to read between the lines here. The term sugar baby is often code for sex worker, and the male moneybags are often crinkled-up creeps. And that leads to a very important question: is this sugar baby phenomenon about empowering women or exploiting them?\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\\n\\n#60MinutesAustralia\"},\"lengthSeconds\":\"1504\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/60Minutes9\",\"externalChannelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS
